    super(props);
    this.state = {
      days: '',
      hours: '',
      minutes: '',
      seconds: '00',
    }
  }

  render() {
    return (
      <div className="App">
        <div className="Title">Nedr√§kning till B+B ses i Mumbai!</div>
        <div className="time"></div>
        <Countdown date={Date.now() + 200}>
          <Completionist/>
        </Countdown>
      </div>
    );
  }
}

export default App;

const Completionist = () => <span>You are good to go!</span>;
